  input: 'TEXT,F3PN,,"The Committee is submitting its original Year End 2006 Form
    F3P for the period October 1, 2006 through December 31, 2006 at this time for
    the following reason:  When the Committee was formed, the instructions for a loan
    from the candidate''s personal funds to the Committee were given to the bank in
    late December 2006 , with instructions that the funds transfer was to be made
    on the first business day in January 2007.  Thinking that its instructions had
    been followed, the Committee filed its First Quarter 2007 F3P report for the period
    January 1, 2007 through March 31, 2007, and in good faith, disclosed the loan
    as having been executed on January 2, 2007.  In the course of preparing the 2nd
    Quarter 2007 Form F3P, the Comimittee discovered that the loan from the candidate''s
    personal account was actually transferred to the Committee''s account on December  24,
    2006.  In addition, another transaction that should have taken place on January
    2, 2007, was executed on December 27, 2006.  In the interest of full disclosure,
    the Committee is submitting an original Year End 2006 Form F3P and an amended
    First Quarter 2007 Form F3P to reflect the actual timing of these transactions.  The
    internal control procedures that the Committee has put into place revealed this
    oversight and will prevent any similar occurences in the future."'
